int main(void)
{
	srand(time(NULL));
	
	//get stuff
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	volatile int * push_ptr = (int *)0xFF200050;
	
	writeNumToSevenSegment(4);
    Player players[4];
	char currentPlayer = 0;
	char numGone = 0;
	numPlayers = 4;
	Square squares[32];
	
	// declare other variables(not shown)
    // initialize location and direction of rectangles(not shown)
	short startxs[4] = {1,20,1,20};
	short startys[4] = {2,2,21,21};
	short colors[4] = {46004,4573,61837,25843};
	short drawxs[32] = {246,218,196, 174, 152, 130, 108, 86,50, 48,48,48,48,48,48,48,50,86,108,130,152,174,196,218, 239,249,249,249,249,249,249,249};
	short drawys[32] = {207, 208,208,208,208,208,208,208,209, 178, 156, 134, 112, 90, 68, 46,9, 6, 6, 6, 6, 6, 6, 6, 7, 46,68,90,112,134,156,178};
	
	for (int i = 0; i < 32; i++){
		squares[i].drawx = drawxs[i];
		squares[i].drawy = drawys[i];
		squares[i].val = 0;
		squares[i].num = i;
	}
	
	char gojail = 24;
	char jail = 8;
	squares[3].val = -200;
	squares[11].val = 100;
	squares[23].val = -100;
	squares[27].val = 150;
	
	for (int i = 0; i < numPlayers; i++){
		players[i].currentSquare = 0;
		players[i].posx = squares[players[i].currentSquare].drawx;
		players[i].posy = squares[players[i].currentSquare].drawy;
		players[i].color = colors[i];
		players[i].cash = 800;
		players[i].num = i;
		players[i].startx = startxs[i];
		players[i].starty = startys[i];
		players[i].place = 0;
	}
	
	
	//pixelbufferstuff
    /* set front pixel buffer to Buffer 1 */
    *(pixel_ctrl_ptr + 1) = (int) &Buffer1; // first store the address in the  back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to Buffer 2 */
    *(pixel_ctrl_ptr + 1) = (int) &Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer
	
	draw_board();
	draw_players(players, currentPlayer, 0);
	wait_for_vsync(); 
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	
	//stage 0, just redraw, stage 1, dice roll
	char stage = 0; 
    while (1)
    {
        // Erase 
        		
		//dice
		char dice = 0;
		
		
		if (stage == 0){stage = 1;}
		else if (stage ==1) {
		
		*(push_ptr+3) = 0b1111;
		while (1){
			stage = 0;
			int keys_pressed = *(push_ptr+3);
			if (keys_pressed & 0b1000){
				dice = 1 + rand()%6;
				break;
			}
		}
		*(push_ptr+3) = 0b1111;
		
		players[currentPlayer].currentSquare = (players[currentPlayer].currentSquare + dice) %32;
		players[currentPlayer].posx = squares[players[currentPlayer].currentSquare].drawx;
		players[currentPlayer].posy = squares[players[currentPlayer].currentSquare].drawy;
		
		players[currentPlayer].cash = players[currentPlayer].cash + calculateSquareCost(players[currentPlayer],
		squares[players[currentPlayer].currentSquare]);
		
		stage = 2;
		}
		else if(stage == 2){
			
			
			*(push_ptr+3) = 0b1111;
			while (1){
				int keys_pressed = *(push_ptr+3);
				if (keys_pressed & 0b0100){
					break;
				}
			}
			*(push_ptr+3) = 0b1111;
			
			if (players[currentPlayer].cash < 0){
				numGone += 1;
				players[currentPlayer].place = numGone;
			}
			currentPlayer = (currentPlayer + 1)%numPlayers;
			while (players[currentPlayer].place != 0){
				currentPlayer = (currentPlayer + 1)%numPlayers;
			}
			stage = 0;
		}
		//draw		
		
		draw_board();
		draw_players(players, currentPlayer, 0);
		writeNumToSevenSegment(players[currentPlayer].cash);
		//refresh
        wait_for_vsync(); 
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		if (numGone == numPlayers-1){
			break;
		}
    }
}

