short decimalToSevenSegment(int n) {
    short segments[10] = {
        0b0111111, 
        0b0000110, 
        0b1011011, 
        0b1001111, 
        0b1100110, 
        0b1101101, 
        0b1111101, 
        0b0000111, 
        0b1111111, 
        0b1101111  
    };
	
    return segments[n % 10];
}
void writeNumToSevenSegment (int num){
	volatile int * segment_ptr1 = (int *)0xFF200020;
	volatile int * segment_ptr2 = (int *)0xFF200030;
	
	if (num > 99999){return;}
	if (num < 0){return;}
	int first = 0;
	int second =  0;
	int digits[6] = {0};
	int curDigit = 0;
	while (num != 0){
		digits[curDigit] = num % 10;
		num = num / 10;
		curDigit += 1;
	}
	first = 0 + decimalToSevenSegment(digits[0])  
	 + (decimalToSevenSegment(digits[1])  << 8)
	 + (decimalToSevenSegment(digits[2]) << 16) + (decimalToSevenSegment(digits[3]) << 24);
	 
	
	second  = 0  + (decimalToSevenSegment(digits[4])) + (decimalToSevenSegment(digits[5]) << 8);

	*(segment_ptr1) = first;
	*(segment_ptr2) = second;
}
short calculateSquareCost(Player p, Square s){
	if (s.val != 0){return s.val;}
	if (s.num == 29){return -400 + rand()%700;};
	
	return 0;
}
